r($,"aH2","ahM",()=>A.a([A.jS("Introducing our groundbreaking emergency medical assistance system - the ultimate lifesaving solution for modern times! Our innovative project consists of:A user-friendly mobile application for Android and iPhone that allows users to request an ambulance with just the touch of a button. With our cutting-edge tracking technology, users can easily monitor the ambulance's progress every step of the way. We even keep the patient's family informed by providing the name and address of the hospital they're headed to. But that's not all - our app is equipped with artificial intelligence to help predict diseases and a smart chatbot to provide first aid advice. Plus, our \"Remind Me\" service lets users add their medication details so they never miss a dosage.\n\nFor paramedics, we've developed a specialized mobile application that allows them to manage patient requests and track progress effortlessly. With our app, paramedics can quickly and efficiently direct patients and keep tabs on their progress in real-time.\n\nOur web-based control panel is the perfect tool for the Egyptian Ministry of Health to manage their paramedic accounts and view all requests in one place. Our system displays new requests, requests under processing, and completed requests with all the necessary details.\n\nOur emergency medical assistance system is designed to be inclusive and accessible to everyone, including patients who may have visual impairments. That's why we've integrated cutting-edge AI technology into our user app, allowing patients to request an ambulance through voice commands. With just a simple voice prompt, the app can identify the patient's location and immediately dispatch an ambulance to their location. This feature ensures that patients with visual impairments can easily and quickly access emergency medical assistance whenever they need it. Our commitment to inclusivity and accessibility is just one of the many ways our emergency medical assistance system sets itself apart from traditional healthcare solutions.\n\nFinally, our emergency medical assistance system is a game-changer in the healthcare industry. With our advanced technology and easy-to-use interfaces, we're revolutionizing the way emergency medical assistance is delivered. Don't wait - join the future of healthcare today!","Emerg-e-care Complete App"),A.jS("Waddi is a cutting-edge mobile application developed using Flutter, designed to revolutionize the delivery and shipping industry. The app seamlessly connects users in need of shipping services with dedicated delegates who ensure safe and efficient deliveries.\nWith Waddi, users can effortlessly place orders for items they want to ship. They can input their delivery requirements, along with relevant information about themselves and the intended recipients. This streamlines the process, making it quick and convenient to send packages to any desired location.\nThe app also caters to delegates responsible for executing deliveries. Delegates receive orders through their dedicated mobile app, enabling them to efficiently manage and track their assigned tasks. The delegates play a crucial role in ensuring that packages are delivered punctually and securely.\nTo enhance communication and provide real-time updates, Waddi incorporates a chat feature powered by Firebase. Users can easily connect with the delegates, enabling effective communication throughout the delivery process. This feature promotes transparency and allows users to address any queries or concerns they may have.\nAdditionally, Waddi provides a comprehensive dashboard for tracking delegates and orders. This dashboard serves as a centralized hub for monitoring the progress of deliveries, ensuring optimal efficiency and customer satisfaction.","Waddy Complete App"),A.jS("I have developed a full-fledged social networking application using Flutter, the popular cross-platform framework for mobile app development. The app is built using Firebase and offers a range of completed features that users need in a social app.\n\nThe app includes advanced features such as user authentication and cloud storage using Firebase, ensuring secure and fast data transfer. I have implemented Bloc pattern for efficient state management and DIO library to fetch data from the server in a fast and reliable manner. Additionally, shared preferences are used to store user preferences and data, providing a seamless user experience.\n\nThe app offers a complete set of social networking features, including the ability to create and edit user profiles, post and view content, follow and unfollow users, and interact with posts through likes and comments. I have also integrated the image_picker package to allow users to upload images and share them with their friends.\n\nOverall, this Social Complete App demonstrates my proficiency in using Flutter and Firebase to create complex, fully functional mobile applications that meet user needs.","Social Complete App"),A.jS("I have developed a complete E-commerce application using Flutter, the popular cross-platform framework for mobile app development. The app is a fully functional online store that allows users to browse products, add them to cart, and checkout securely.\n\nTo enhance the user experience and improve the app's performance, I have implemented advanced features such as carousel widgets for smooth product browsing and Bloc pattern for efficient state management. I have also integrated DIO library to consume APIs and fetch data from the server in a fast and reliable manner.\n\nOne of the key features of the app is its ability to store user preferences and data using shared preferences, which allows for a seamless shopping experience across devices.\n\nOverall, this E-commerce Complete App showcases my proficiency in using Flutter and implementing complex features to deliver high-quality mobile applications.","E-Commerce Complete App"),A.jS("I have developed a responsive portfolio user interface (UI) using Flutter, the popular cross-platform framework for mobile app development. The UI is designed to showcase my skills, experience, and projects in a visually appealing and user-friendly manner.\n\nThe portfolio UI includes a range of advanced features, such as a responsive layout for optimal viewing on various screen sizes, custom animations for a dynamic user experience, and a user-friendly navigation system for easy browsing.\n\nOverall, this Responsive Portfolio - Flutter UI showcases my proficiency in using Flutter to create visually stunning and user-friendly applications. It also demonstrates my ability to create custom solutions for specific design needs.","Responsive Portfolio - Flutter UI"),A.jS("I have developed a comprehensive online store application using Flutter for a group of companies to showcase their products. The app, called 8Q-Store Shop, includes advanced features such as a carousel widget for smooth product browsing, and the Bloc pattern for efficient state management. I have also used the DIO package to consume APIs and fetch data from the server in a fast and reliable manner. Additionally, I have implemented shared preferences to store user data and preferences, providing a seamless shopping experience.\n\nThe 8Q-Store Shop App offers a wide range of products from various companies, making it a one-stop-shop for customers. Users can browse products, view product details, add products to cart, and checkout securely. The app also includes a personalized user profile, where users can view their order history and track their order status.\n\nOverall, this 8Q-Store Shop App showcases my proficiency in using Flutter and integrating complex features to create high-quality mobile applications. It also demonstrates my ability to create custom solutions for specific business needs.","8Q-Store"),A.jS("We Work is a powerful mobile app that connects job seekers and companies in a seamless and efficient way. Job seekers can upload their CVs and create profiles, showcasing their skills and experience. Companies can post job opportunities and browse through candidate profiles. Job seekers can explore available jobs and apply directly through the app, while companies can offer jobs to potential candidates. Say goodbye to traditional job search methods and embrace We Work for a streamlined and effective job matching experience.","We Work Complete App"),A.jS("I have developed a weather application using Flutter, the popular cross-platform framework for mobile app development. The app offers real-time weather information for locations worldwide, including current conditions, forecasts, and more.\n\nTo ensure fast and reliable data transfer, I have implemented the DIO package to consume weather APIs. I have also used the Bloc pattern for efficient state management and shared preferences to store user data and preferences, providing a seamless user experience.\n\nThe app includes a range of advanced features, such as a user-friendly interface for easy navigation, the ability to view weather data for multiple locations, and customizable settings for temperature units and language preferences. Additionally, the app offers alerts for severe weather conditions, ensuring user safety and wellbeing.\n\nOverall, this Weather App showcases my proficiency in using Flutter and integrating complex features to create high-quality mobile applications. It also demonstrates my ability to create user-friendly solutions for everyday needs.","Weather App"),A.jS("I have developed a comprehensive news browsing application using Flutter, the popular cross-platform framework for mobile app development. The app offers access to all the latest and exclusive news from leading Egyptian news sites, as well as the ability to search for both national and international news.\n\nTo ensure fast and reliable data transfer, I have implemented the DIO helper package to consume free news APIs. I have also used the Bloc pattern for efficient state management and shared preferences to store user preferences and data.\n\nThe app includes a range of advanced features, such as a user-friendly interface for easy browsing and search, the ability to save favorite articles, and social media sharing options. Additionally, the app offers a personalized news feed based on user preferences, ensuring a tailored news experience for each user.\n\nOverall, this News Complete App showcases my proficiency in using Flutter and integrating complex features to create high-quality mobile applications that meet user needs.","News APP"),A.jS("I have developed a comprehensive to-do application using Flutter, the popular cross-platform framework for mobile app development. The app, called TODO App, allows users to manage their tasks efficiently and effectively.\n\nTo ensure efficient state management, I have implemented the Bloc pattern, and to store user data, I have used the Sqflite package, a lightweight database solution for Flutter. This allows for fast and reliable data storage and retrieval.\n\nThe TODO App includes a range of advanced features, such as a user-friendly interface for easy task management, the ability to add, edit, and delete tasks, and customizable settings for sorting tasks based on priority or due date. Additionally, the app offers reminders and notifications for upcoming tasks, ensuring that users never miss a deadline.\n\nOverall, this TODO App showcases my proficiency in using Flutter and integrating complex features to create high-quality mobile applications. It also demonstrates my ability to create user-friendly solutions for everyday needs.","TODO APP")],A.a2("u<Ig>")))
